using System;
using System.Runtime.InteropServices;

namespace MinimizeConsoleApp {
    class Program {
        [DllImport("user32.dll")]
        static extern bool ShowWindow(IntPtr handle, int nCmdShow);

        static IntPtr GetMainWindowHandle() {
            var mainWindow = Process.GetCurrentProcess().MainWindowHandle;
            return mainWindow;
        }

        static void Main(string[] args) {
            // Run the app normally first
            Application.EnableVisualStyles();
            Application.SetCompatibleTextRenderingDefault(false);
            Process.Start("C:\\path\\to\\your\\application.exe");

            // After some time, show the window minimized
            var mainWindowHandle = GetMainWindowHandle();
            ShowWindow(mainWindowHandle, SW_MINIMIZE);
        }
    }
}
